        source: ["pragma solidity ^0.4.21;","","","contract MyPrize {","  struct Prize {","    bytes10 geohash;","    address owner;","    uint placedAt;","    uint id;","    string metadata;","  }","","  ","  mapping (uint => Prize) public prizes;","","  constructor() public {","        for (uint i = 1; i <= 10; i++) {","            Prize memory prize = Prize({id: i, owner: msg.sender, geohash:\"\", metadata:\"\", placedAt: 0});","            prizes[i] = prize;","        }","    }","","    function placePrize (uint prizeId, bytes10 geohash, string _metadata) public {","        Prize storage prize = prizes[prizeId];","        require(prize.id != 0);","        require(geohash != bytes10(\"\"));","        require(prize.owner == address(0) || msg.sender == prize.owner);","        prize.owner = address(0);","        prize.geohash = geohash;","        prize.metadata = _metadata;","        prize.placedAt = block.number;","    }","","    function claimPrize (uint prizeId, bytes10 geohash) public {","        Prize storage prize = prizes[prizeId];","        require(prize.id != 0);","        require(geohash != bytes10(\"\") && prize.geohash == geohash);","        require(block.number - prize.placedAt > 1000);","        prize.owner = msg.sender;","        prize.geohash = \"\";","        prize.metadata = \"\";","        prize.placedAt = 0;","    }","}"],
